import React, { Component } from 'react';
import TodoForm from './TodoForm';
import List from './List';

const App = () => {
    const onTodoForm = (item) => {
        alert(item);
    }
    return (
        <div>
            <TodoForm />
            <List onTodoForm={onTodoForm} />
        </div>
    )
}



export default App;
